import { BrowserRouter as Router, Route } from "react-router-dom";
import "./App.css";
import Search from "./pages/Search";
import Saved from "./pages/Saved";

function App() {
  return (
    <div className="App">
      <Router>
        <div className="app">
          <Route exact path="/" component={Search} />
          <Route exact path="/portfolio" component={Saved} />
        </div>
      </Router>
    </div>
  );
}

export default App;
